const Menu = () => {
  return (
    <div className="menu">
      <h2>Settings</h2>
      <ul>
        <li>Widget Display Options</li>
        <li>Data Sources</li>
        <li>Theme</li>
        <li>Refresh Rate</li>
      </ul>
    </div>
  );
};

export default Menu;
